const Service_Side = ({ service }) => {
  return (
    <aside className="flex flex-col md:col-span-2 gap-y-5">
      <div className="border-mac pt-2 pb-5">
        <h4 className="title"># مشخصات</h4>
        <ul>
          {service.details((item, index) => {
            return (
              <li>
                <span>{item}</span>
                <span></span>
              </li>
            );
          })}
        </ul>
      </div>
    </aside>
  );
};

